Values defined outside WhileRegion op are sometimes explicitly captured and yielded. Such operands and results can be dropped. For example, `%arg1` operand in the following While loop can be dropped.

```
func @computation(%arg0: tensor<i32>, %arg1: tensor<!tf.resource<tensor<f32>>>) {
  %0 = "tf.WhileRegion"(%arg1) ( {
  ^cond(%carg0: !tf_res_static):
    %1 = "tf.Const"() {value = dense<true> : tensor<i1>} : () -> tensor<i1>
    "tf.Yield"(%1) : (tensor<i1>) -> ()
  }, {
  ^body(%barg0: !tf_res_static):
    "tf.Yield"(%arg1) : (!tf_res_static) -> ()
  }) {is_stateless = false} : (tensor<!tf.resource<tensor<f32>>>) -> tensor<!tf.resource<tensor<f32>>>
  return
}
```

